def seven_segment_to_binary(s):
    """"""
    segment_display_mapping = {'0': '1111110', '1': '0110000', '2': '1101101', '3': '1111001', '4': '0110011', '5': '1011011', '6': '1011111', '7': '1110000', '8': '1111111', '9': '1111011'}
    binary_equivalent = ''
    for digit in s:
        binary_equivalent += segment_display_mapping[digit]
    return binary_equivalent
